        //<h1>Oi</h1>
        <div className="post" >
            <img src={post.cover} alt={post.title}/>              
            <div className="post-contente">
            <h1>{post.title}</h1>
            <p>{ post.body }</p>
            </div>          
        </div>
    );
}
